window.bookSummaryJSON = "<p><b>Using his flesh-twisting powers, Seraph must push on to reach the ancient guardians.</b></p> <p>After nearly losing access, Seraph sets out again to conquer NEO and save his tormented sibling.</p> <p>Pushing deeper into the woodland, the Heart of The Forest is finally within reach, but the overpowered druidic guardians are merely the most obvious obstacle in his path.</p> <p>The line blurs between right and wrong, allies and enemies as the plot thickens, but Seraph will stop at nothing, readily accepting any who stand in his way as what they truly are—raw materials for the reaping …</p>"; 
